We can't find $\sin x$ and $\cos x$ directly, but we can use a trick!

Square the equation $\sin x + \cos x = \frac{1}{5}$:

\begin{align*}
(\sin x + \cos x)^2 &= \left(\frac{1}{5}\right)^2 \\
\sin^2 x + 2 \sin x \cos x + \cos^2 x &= \frac{1}{25}
\end{align*}

Remember that $\sin^2 x + \cos^2 x = 1$, so we can simplify:

\begin{align*}
1 + 2 \sin x \cos x &= \frac{1}{25} \\
2 \sin x \cos x &= -\frac{24}{25}
\end{align*}

Now, divide the equation $\tan x = \frac{\sin x}{\cos x}$ by $\cos x$:

\begin{align*}
\tan x &= \frac{\sin x}{\cos x} \\
&= \frac{\sin x \cos x}{\cos^2 x}
\end{align*}

We know $2 \sin x \cos x = -\frac{24}{25}$, so:

\begin{align*}
\tan x &= \frac{-\frac{24}{25}}{2 \cos^2 x} \\
&= -\frac{12}{25 \cos^2 x}
\end{align*}

We can't find $\cos x$ directly, but we can use the original equation $\sin x + \cos x = \frac{1}{5}$ to express $\cos^2 x$ in terms of $\sin x$.  Then we can substitute that into the equation for $\tan x$.
